import { Route } from "react-router-dom";
import MainHeader from "./layout/MainHeader";
import AboutPage from "./pages/AboutPage";
import Store from "./pages/Store";

function App() {
  return (
    <div>
      <header>
        <MainHeader />
      </header>
      <main>
        <Route path='/about'>
          <AboutPage/>
        </Route>
        <Route path='/store'>
          <Store/>
        </Route>
      </main>
    </div>
  );
}

export default App;
